import * as o from "react";
import n from "../lib/IconBase.es.js";
import a from "../defs/Crown.es.js";
const r = o.forwardRef((e, t) => /* @__PURE__ */ o.createElement(n, { ref: t, ...e, weights: a }));
r.displayName = "CrownIcon";
const s = r;
export {
  s as Crown,
  r as CrownIcon
};
